function getUsuario(n,t){$.ajax({type:"POST",url:t,data:{id:n},success:function(n){mostrarUsuario(n)}})}function mostrarUsuario(n){items=n;$.each(items,function(n,t){$("input[name=Id]").val(t.id);$("input[name=UserName]").val(t.userName);$("input[name=Email]").val(t.email)})}$("#modalEditar").on("shown.bs.modal",function(){$("#myInput").focus()});var items;